import React from "react";

const Hero = () => {
    return (
        <section class="hero is-success">
            <div class="hero-body">
                <div class="container">
                    <h1 class="title">ページ作り</h1>
                    <h2 class="subtitle">bulma凄い。</h2>
                </div>
            </div>
        </section>
    );
};

const Body1 = () => {
    return (
    <section class="section">
        <div class="container">
            <h2 class="subtitle">ボタンの表示</h2>
        </div>
    </section>
    );
}

const Footer = () => {
    return (
        <footer className = "footer">
            <dvi class = "content has-text-centered">
                <p>&copy; 2020 miura</p>
            </dvi>
        </footer>
    );
}

const App = () => {
    return (
        <div>
            <Hero />
            <Body1 />
            <Footer />
        </div>
    );
};

export default App;
